script: |
  super -f text -I q4735.spq | sort > q4735.out

inputs:
  - name: q4735.spq
    data: |
      SELECT DISTINCT - + col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( col2 ) NOT BETWEEN + CAST ( + + col2 AS INTEGER ) + - 83 + - 2 * - 30 AND NULL;
  - name: tab1

outputs:
  - name: q4735.out
    data: |
